import React from "react"
import fetchjob from "./Fetchjob"
import Container from "react-bootstrap"
import "./index.css"


const App = ()=>{
   const {jobs,loading,error} = fetchjob()
   return (
       <>

       {loading} && <h1>Loading...</h1>
       {error} && <h1>Try again. </h1>
       <h1> {jobs.length}</h1>
       </>
   )

   }

export default App;
